import React from "react";
import {Route, Switch} from "react-router-dom"
import GitHub from "../github/github.js"

export default function Contenct(){
    return(
        <Switch>
          <Route exact path="/">
            <h1>home</h1>
          </Route>
          <Route path="/github">
            <GitHub/>
          </Route>
        </Switch>
    )
}
